    true,nt"url": null,nt"notes": "<p>The NINDS Parkinsonu2019s Disease (PD)
    Biomarkers Program Data Management Resource enables web-based data entry for clinical
    studies supporting PD biomarker development, as well as broad data sharing (imaging,
    clinical, genetic, and biospecimen analysis) across the entire PD research community.
    The PDBP DMR coordinates information and access to PD biospecimens distributed through
    the NINDS Human Genetics, DNA, iPSC , Cell Line and Biospecimen Repository and the
    Harvard Neurodiscovery Initiative.</p>n",nt"license_title": "Other License
